import React from "react";
import Selector from "./selector";
import { BiCloudLightRain } from "react-icons/bi";

const find=(formData)=>{
    const city=formData.get("city");
    const filter=null;
    console.log('city',city);   
}

const publish=(formData)=>{
    const city=formData.get("city");
    alert(`Searching for property in ${city}`);   
}

const Search= () => {
    return ( 
        <>
        <div className="p-5" >
            <h1 className="text-[#00df9a] md:text-6xl  text-center font-tit">Find your dream home</h1>
        </div>
        <div className="w-full border-2 flex items-center">
            <form action={find} className="flex-col margin items-center p-3" >
                <label htmlFor="search" className="text-[#00df9a] ">City :  </label>
                <input className="bg-[#F7FFF7] rounded" type="text" placeholder=" Search for city" />
                <br />
                <Selector/>
                <br/>
                <button className="text-[#00df9a]" formAction={publish} type="submit" name="button" value="submit">Search</button>
            </form>
        </div>
        </>
     );
}
 
export default Search;
